DROP TABLE IF EXISTS `patitas_mensajes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `patitas_mensajes` (
  `id` int NOT NULL AUTO_INCREMENT,
  `remitente_tipo` enum('dueno','cuidador') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  `remitente_id` int DEFAULT NULL,
  `destinatario_tipo` enum('dueno','cuidador') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  `destinatario_id` int DEFAULT NULL,
  `mensaje` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci,
